import React, { useState, useEffect } from 'react';
import { motion } from 'framer-motion';
import { X, Car, DollarSign, Loader } from 'lucide-react';
import { useApp } from '../../context/AppContext.tsx';
import { CarValuationService } from '../../services/carValuationService.ts';
import { Vehicle } from '../../types/index.ts';

interface VehicleFormProps {
  vehicle?: Vehicle;
  onClose: () => void;
}

export function VehicleForm({ vehicle, onClose }: VehicleFormProps) {
  const { addVehicle, updateVehicle, state } = useApp();
  const [loading, setLoading] = useState(false);
  const [estimating, setEstimating] = useState(false);
  const [formData, setFormData] = useState({
    make: vehicle?.make || '',
    model: vehicle?.model || '',
    year: vehicle?.year || '',
    mileage: vehicle?.mileage || '',
    color: vehicle?.color || '',
    transmission: vehicle?.transmission || 'automatic' as const,
    fuelType: vehicle?.fuelType || 'gasoline' as const,
    bodyType: vehicle?.bodyType || 'sedan' as const,
    condition: vehicle?.condition || 'good' as const,
    vin: vehicle?.vin || '',
    estimatedValue: vehicle?.estimatedValue || 0,
    customPrice: vehicle?.customPrice || '',
  });

  const [makes] = useState(CarValuationService.getPopularMakes());
  const [models, setModels] = useState(CarValuationService.getModelsForMake(formData.make));

  useEffect(() => {
    setModels(CarValuationService.getModelsForMake(formData.make));
  }, [formData.make]);

  const handleChange = (e: React.ChangeEvent<HTMLInputElement | HTMLSelectElement>) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const estimateValue = async () => {
    if (!formData.make || !formData.model || !formData.year) {
      alert('Please fill in make, model, and year to estimate value');
      return;
    }

    setEstimating(true);
    try {
      const valuation = await CarValuationService.getValuation(
        formData.make,
        formData.model,
        formData.year,
        formData.mileage,
        formData.condition
      );
      setFormData(prev => ({ ...prev, estimatedValue: valuation.estimatedValue }));
    } catch (error) {
      console.error('Failed to estimate value:', error);
      alert('Failed to estimate vehicle value. Please try again.');
    } finally {
      setEstimating(false);
    }
  };

  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault();
    setLoading(true);

    try {
      if (!state.currentUser) {
        throw new Error('User not authenticated');
      }

      const vehicleData = {
        ...formData,
        images: [], // Will be added later
        ownerId: state.currentUser.id,
      };

      if (vehicle) {
        updateVehicle({ ...vehicle, ...vehicleData });
      } else {
        addVehicle(vehicleData);
      }

      onClose();
    } catch (error) {
      console.error('Failed to save vehicle:', error);
      alert('Failed to save vehicle. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  return (
    <motion.div
      initial={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      exit={{ opacity: 0 }}
      className="fixed inset-0 bg-black/50 flex items-center justify-center p-4 z-50"
      onClick={(e) => e.target === e.currentTarget && onClose()}
    >
      <motion.div
        initial={{ scale: 0.9, opacity: 0 }}
        animate={{ scale: 1, opacity: 1 }}
        exit={{ scale: 0.9, opacity: 0 }}
        className="glass-effect rounded-2xl p-6 w-full max-w-2xl max-h-[90vh] overflow-y-auto"
      >
        <div className="flex items-center justify-between mb-6">
          <div className="flex items-center space-x-3">
            <div className="w-10 h-10 bg-primary-500 rounded-full flex items-center justify-center">
              <Car className="w-5 h-5 text-white" />
            </div>
            <div>
              <h2 className="text-2xl font-bold text-primary-100">
                {vehicle ? 'Edit Vehicle' : 'Add New Vehicle'}
              </h2>
              <p className="text-primary-300">
                {vehicle ? 'Update your vehicle information' : 'Add a vehicle to your garage'}
              </p>
            </div>
          </div>
          <button
            onClick={onClose}
            className="p-2 hover:bg-primary-800/50 rounded-full transition-colors"
          >
            <X className="w-5 h-5 text-primary-300" />
          </button>
        </div>

        <form onSubmit={handleSubmit} className="space-y-4">
          <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
            <div>
              <label className="block text-sm font-medium text-primary-200 mb-1">
                Make *
              </label>
              <select
                name="make"
                value={formData.make}
                onChange={handleChange}
                className="input-field"
                required
              >
                <option value="">Select Make</option>
                {makes.map(make => (
                  <option key={make} value={make}>{make}</option>
                ))}
              </select>
            </div>

            <div>
              <label className="block text-sm font-medium text-primary-200 mb-1">
                Model *
              </label>
              <select
                name="model"
                value={formData.model}
                onChange={handleChange}
                className="input-field"
                required
                disabled={!formData.make}
              >
                <option value="">Select Model</option>
                {models.map(model => (
                  <option key={model} value={model}>{model}</option>
                ))}
              </select>
            </div>

            <div>
              <label className="block text-sm font-medium text-secondary-700 mb-1">
                Year *
              </label>
              <input
                type="number"
                name="year"
                value={formData.year}
                onChange={handleChange}
                className="input-field"
                min="1900"
                max={new Date().getFullYear() + 1}
                required
              />
            </div>

            <div>
              <label className="block text-sm font-medium text-secondary-700 mb-1">
                Mileage *
              </label>
              <input
                type="number"
                name="mileage"
                value={formData.mileage}
                onChange={handleChange}
                className="input-field"
                min="0"
                required
              />
            </div>

            <div>
              <label className="block text-sm font-medium text-secondary-700 mb-1">
                Color *
              </label>
              <input
                type="text"
                name="color"
                value={formData.color}
                onChange={handleChange}
                className="input-field"
                placeholder="e.g., White, Black, Red"
                required
              />
            </div>

            <div>
              <label className="block text-sm font-medium text-secondary-700 mb-1">
                Condition *
              </label>
              <select
                name="condition"
                value={formData.condition}
                onChange={handleChange}
                className="input-field"
                required
              >
                <option value="excellent">Excellent</option>
                <option value="good">Good</option>
                <option value="fair">Fair</option>
                <option value="poor">Poor</option>
              </select>
            </div>

            <div>
              <label className="block text-sm font-medium text-secondary-700 mb-1">
                Transmission
              </label>
              <select
                name="transmission"
                value={formData.transmission}
                onChange={handleChange}
                className="input-field"
              >
                <option value="automatic">Automatic</option>
                <option value="manual">Manual</option>
              </select>
            </div>

            <div>
              <label className="block text-sm font-medium text-secondary-700 mb-1">
                Fuel Type
              </label>
              <select
                name="fuelType"
                value={formData.fuelType}
                onChange={handleChange}
                className="input-field"
              >
                <option value="gasoline">Gasoline</option>
                <option value="diesel">Diesel</option>
                <option value="hybrid">Hybrid</option>
                <option value="electric">Electric</option>
              </select>
            </div>

            <div>
              <label className="block text-sm font-medium text-secondary-700 mb-1">
                Body Type
              </label>
              <select
                name="bodyType"
                value={formData.bodyType}
                onChange={handleChange}
                className="input-field"
              >
                <option value="sedan">Sedan</option>
                <option value="suv">SUV</option>
                <option value="truck">Truck</option>
                <option value="coupe">Coupe</option>
                <option value="hatchback">Hatchback</option>
                <option value="convertible">Convertible</option>
                <option value="wagon">Wagon</option>
              </select>
            </div>

            <div>
              <label className="block text-sm font-medium text-secondary-700 mb-1">
                VIN (Optional)
              </label>
              <input
                type="text"
                name="vin"
                value={formData.vin}
                onChange={handleChange}
                className="input-field"
                placeholder="Vehicle Identification Number"
              />
            </div>
          </div>

          <div className="border-t pt-4">
            <div className="flex items-center justify-between mb-4">
              <h3 className="text-lg font-semibold text-primary-100">Valuation</h3>
              <button
                type="button"
                onClick={estimateValue}
                disabled={estimating || !formData.make || !formData.model}
                className="btn-secondary flex items-center space-x-2 disabled:opacity-50"
              >
                {estimating ? (
                  <Loader className="w-4 h-4 animate-spin" />
                ) : (
                  <DollarSign className="w-4 h-4" />
                )}
                <span>Estimate Value</span>
              </button>
            </div>

            <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
              <div>
                <label className="block text-sm font-medium text-secondary-700 mb-1">
                  Estimated Value
                </label>
                <div className="input-field bg-primary-800/30 text-primary-300">
                  ${formData.estimatedValue.toLocaleString()}
                </div>
              </div>

              <div>
                <label className="block text-sm font-medium text-secondary-700 mb-1">
                  Custom Price (Optional)
                </label>
                <input
                  type="number"
                  name="customPrice"
                  value={formData.customPrice || ''}
                  onChange={handleChange}
                  className="input-field"
                  min="0"
                  placeholder="Override estimated value"
                />
              </div>
            </div>
          </div>

          <div className="flex space-x-3 pt-6">
            <button
              type="button"
              onClick={onClose}
              className="flex-1 btn-secondary"
              disabled={loading}
            >
              Cancel
            </button>
            <button
              type="submit"
              disabled={loading}
              className="flex-1 btn-primary disabled:opacity-50"
            >
              {loading ? (
                <div className="flex items-center justify-center space-x-2">
                  <Loader className="w-4 h-4 animate-spin" />
                  <span>Saving...</span>
                </div>
              ) : (
                <span>{vehicle ? 'Update Vehicle' : 'Add Vehicle'}</span>
              )}
            </button>
          </div>
        </form>
      </motion.div>
    </motion.div>
  );
}
